import React, { useState, useEffect } from 'react';

// Account Details needs to show the most recent transactions and make sure it fetches the correct amout for each account balance.

const AccountDetails = ({ details }) => {
    const [accountDetails, setAccountDetails] = useState(details || null);

    useEffect(() => {
        if (!details) {
            // Dummy data for testing
            const dummyData = {
                accountHolderName: 'John Doe',
                accountHolderID: '123456789',
                accounts: [
                    { accountNumber: '111222333', accountType: 'Checking', balance: 1500.0 },
                    { accountNumber: '444555666', accountType: 'Savings', balance: 3000.0 },
                    { accountNumber: '777888999', accountType: 'Investment', balance: 5000.0 },
                ],
                transactions: [
                    { id: 1, date: '2024-07-31', type: 'Deposit', amount: 500, accountType: 'Checking' },
                    { id: 2, date: '2024-07-30', type: 'Withdrawal', amount: 200, accountType: 'Savings' },
                    { id: 3, date: '2024-07-29', type: 'Investment', amount: 300, accountType: 'Investment' },
                    { id: 4, date: '2024-07-28', type: 'Withdrawal', amount: 150, accountType: 'Checking' },
                    { id: 5, date: '2024-07-27', type: 'Deposit', amount: 100, accountType: 'Savings' },
                    { id: 6, date: '2024-07-26', type: 'Withdrawal', amount: 250, accountType: 'Investment' },
                ],
            };
            setAccountDetails(dummyData);

            // Uncomment below to use actual API endpoint
            // axios.get('/api/account-details')
            //     .then(response => {
            //         setAccountDetails(response.data);
            //     })
            //     .catch(error => {
            //         console.error('There was an error fetching the account details!', error);
            //     });
        }
    }, [details]);

    if (!accountDetails) {
        return <div className="text-center">Loading...</div>;
    }

    // Limit to 5 most recent transactions
    const recentTransactions = accountDetails.transactions.slice(0, 3);

    return (
        <div className="container my-4">
            <div className="card shadow">
                <div className="card-body">
                    <h2 className="text-center mb-4">Account Details</h2>
                    <div className="mb-3">
                        <p className="text-muted mb-1"><strong>Account Holder:</strong> {accountDetails.accountHolderName}</p>
                        <p className="text-muted mb-1"><strong>Account ID:</strong> {accountDetails.accountHolderID}</p>

                        
                        {accountDetails.accounts.map((account, index) => (
                            <div key={index} className="border rounded p-3 mb-3">
                                <h5 className="mb-2">{account.accountType} Account</h5>
                                <p className="mb-1"><strong>Balance:</strong> ${account.balance.toFixed(2)}</p>
                            </div>
                        ))}
                    </div>
                    <h4 className="text-secondary">Recent Transactions</h4>
                    <div className="table-responsive">
                        <table className="table table-striped table-bordered">
                            <thead className="thead-dark">
                                <tr>
                                    <th>Date</th>
                                    <th>Type</th>
                                    <th>Amount</th>
                                    <th>Account Type</th>
                                </tr>
                            </thead>
                            <tbody>
                                {recentTransactions.map(transaction => (
                                    <tr key={transaction.id}>
                                        <td>{transaction.date}</td>
                                        <td>{transaction.type}</td>
                                        <td>${transaction.amount.toFixed(2)}</td>
                                        <td>{transaction.accountType}</td>
                                    </tr>
                                ))}
                            </tbody>
                        </table>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AccountDetails;
